import Nav from 'react-bootstrap/Nav';
import { Link } from 'react-router-dom';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import 'bootstrap/dist/css/bootstrap.min.css';
import './Home.css';
function Home() {
    return (
        <>
            <Nav justify variant="tabs" activeKey="0">
                <Nav.Item>
                    <Nav.Link as={Link} to="/" eventKey="0">Home</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                    <Nav.Link as={Link} to="/photo" eventKey="1">Photography</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                    <Nav.Link as={Link} to="/film" eventKey="2">Film</Nav.Link>
                </Nav.Item>
                <Nav.Item>
                    <Nav.Link as={Link} to="/Contact" eventKey="3"> Contact </Nav.Link>
                </Nav.Item>
            </Nav>
        </>
    );
}
export default Home;
